import axios from "axios";
const url="http://localhost:8080/CustomerS/"

export const addCT=(item)=>{
    return axios.post(url+"add/",item)
}
export const isexsistCT=async(name,pass)=>{
    
    
    const {data}=await axios.get(url+"isexist/"+name+"/"+pass)
    console.log(data);
    return data
    
}
